import './App.css';
import {BemVindo, BemVindo2, BemVindo3} from './bemvindo.js';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <BemVindo />
        <BemVindo2 nome="João da Silva"/>
        <BemVindo3 />
      </header>
    </div>
  );
}

export default App;
